import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible and enter 'team'
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'team');

    // Take screenshot after entering the search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input_filled.png'));

    // Click the search button
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');

    // Wait for the results to load
    await page.waitForLoadState('networkidle');

    // Take screenshot of the results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_results.png'));

    // Extract meaningful data to verify task completion
    const results = await page.$$eval('.event-result', elements => elements.map(el => el.textContent));

    return {
      success: true,
      action: "Searched for team events and captured results",
      extractedData: { results },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

